import apache_beam as beamimport json# The DoFn to perform on each element in the input PCollection.class Split(beam.DoFn):    def process(self, element):        print(element[1])        output = json.loads(element[1])['fullDocument']        return [output]def run():    p = beam.Pipeline('DirectRunner')    (p | 'ReadMessage' >> beam.io.textio.ReadFromTextWithFilename('input/inputs.txt')       | 'Processing' >> beam.ParDo(Split())       | 'Write' >> beam.io.WriteToText('input/results.txt'))    result = p.run()    result.wait_until_finish()if __name__ == "__main__":    run()